  {item: "199453", title: "Очистка воды Tetra ClearTabs 12 tab", long_name: "Cредство для очистки воды от всех видов мути и поддержания чистоты Tetra ClearTabs 12 таблеток на 720 л", description: "ClearTabs 12tab - Средство для очистки воды от всех видов мути и поддержания чистоты 12 табл. на 720л. Таблетки ClearTabs преобразуют водопроводную воду в аквариумную и безопасную для жизни рыб и делают воду прозрачной в течении нескольких часов. Средство объединяет маленькие плавающие частицы мути в более крупные соединения, которые способен отфильтровать фильтр.\nДозировка 1 таблетка на 60 л. аквариумной воды.\n  ", price: 342.0, producer: "Tetra", item_id: "41e99799-fdc5-11e2-81e7-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "ochistka-vody-tetra-cleartabs-12-tab", html_keywords: nil, html_description: nil},
