  {item: "Tet-767966", title: "Поддержание параметров воды Tetra EasyBalance 500 ml ", long_name: "Кондиционер для поддержания параметров воды Tetra EasyBalance 500 мл на 2000 л ", description: "EasyBalance -  кондиционер для поддержания параметров воды. Надежно стабилизирует рН и карбонатную жесткость (КН) воды. Биологическим способом удаляет фосфаты и нитраты, тем самым уменьшая рост нежелательных водорослей. Дополняет аквариумную воду витаминами, микроэлементами и минералами, снижает количество подмен воды. Обеспечивает здоровую среду обитания для Ваших растений и рыб в пресноводном аквариуме на протяжении 6 месяцев.\nИнструкции по применению: каждую неделю добавлять 2,5 мл EasyBalance на 10 литров аквариумной воды. Еженедельное использование EasyBalance позволит менять воду в аквариуме дважды в год. \nДозировка 500 мл. на 2000 л. аквариумной воды.\n", price: 362.0, producer: "Tetra", item_id: "41e9979f-fdc5-11e2-81e7-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "podderzhanie-parametrov-vody-tetra-easybalance-500-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-123373", title: "Удаления нитратов Tetra Nitrate Minus Pearls 100 ml", long_name: "Средство для удаления нитратов в гранулах Tetra Nitrate Minus Pearls 100 мл", description: "Nitrate Minus Pearls 100ml Средство для удаления нитратов в аквариумной воде на 12 месяцев биологическим путем. Препарат устраняет питательный элемент, необходимый для развития водорослей, что позволяет на долгое время улучшить качество воды, уменьшив, тем самым, потребность в уходе за аквариумом. Препарат закапывается в грунт и непрерывно разлагается бактериями. Снижение показателя содержания нитратов до уровня, менее чем 40-50 мг/л (в зависимости от условий аквариума), применяется один раз в 12 месяцев. С целью увеличения эффекта можно увеличить дозировку в два раза.\nДозировка 8 г. на 10 л. аквариумной воды.", price: 188.0, producer: "Tetra", item_id: "41e997a2-fdc5-11e2-81e7-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "udaleniya-nitratov-tetra-nitrate-minus-pearls-100-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-139268", title: "Удобрение Tetra PlantaMin 100 ml", long_name: "Жидкое удобрение для растений с железом Tetra PlantaMin 100 мл на 200 л ", description: "PlantaMin это интенсивное жидкое удобрение, содержащее железо и комплекс всех питательных веществ. Растения принимает насыщено-зеленый цвет и становиться пышными. Препарат гарантирует равномерное длительное снабжение остаточными элементами. Не содержит нитраты и фосфор, не нарушает естественную среду в аквариуме.\nДозировка 100мл. на 200л. аквариумной воды.", price: 113.0, producer: "Tetra", item_id: "41e997a4-fdc5-11e2-81e7-bcaec546836b", group_id: "e3cd9143-fab0-11e2-afe6-bcaec546836b", permalink: "udobrenie-tetra-plantamin-100-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-139299", title: "Удобрение Tetra PlantaMin 250 ml", long_name: "Жидкое удобрение для растений с железом Tetra PlantaMin 250 мл на 500 л ", description: "PlantaMin это интенсивное жидкое удобрение, содержащее железо и комплекс всех питательных веществ. Растения принимает насыщено-зеленый цвет и становиться пышными. Препарат гарантирует равномерное длительное снабжение остаточными элементами. Не содержит нитраты и фосфор, не нарушает естественную среду в аквариуме.\nДозировка 250 мл. на 500л. аквариумной воды.", price: 219.0, producer: "Tetra", item_id: "41e997a5-fdc5-11e2-81e7-bcaec546836b", group_id: "e3cd9143-fab0-11e2-afe6-bcaec546836b", permalink: "udobrenie-tetra-plantamin-250-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-751712", title: "Удобрение Tetra PlantaMin 500 ml", long_name: "Жидкое удобрение для растений с железом Tetra PlantaMin 500 мл на 1000 л ", description: "PlantaMin это интенсивное жидкое удобрение, содержащее железо и комплекс всех питательных веществ. Растения принимает насыщено-зеленый цвет и становиться пышными. Препарат гарантирует равномерное длительное снабжение остаточными элементами. Не содержит нитраты и фосфор, не нарушает естественную среду в аквариуме.\nДозировка 500мл. на 1000л. аквариумной воды.", price: 359.0, producer: "Tetra", item_id: "41e997a6-fdc5-11e2-81e7-bcaec546836b", group_id: "e3cd9143-fab0-11e2-afe6-bcaec546836b", permalink: "udobrenie-tetra-plantamin-500-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-177727", title: "Подготовка воды для черепах Tetra ReptoSafe 100 ml", long_name: "Кондиционер для подготовки воды для водных черепах Tetra ReptoSafe 100 мл", description: "ReptoSafe это жидкий кондиционер, быстро преобразующий водопроводную воду в пригодную для жизни рептилий. ReptoSafe связывает тяжелые металлы, полностью нейтрализует хлор и создает окружающую среду, максимально приближенную к природным условиям обитания черепах. Коллоидный раствор серебра защищает кожу черепах и сокращают риск возникновения кожных заболеваний. Магний и витамин В1 уменьшают стрессовый эффект и сокращают риск возникновения болезней. \nДозировка 5 мл. на 10 л. аквариумной воды.", price: 154.0, producer: "Tetra", item_id: "41e997a8-fdc5-11e2-81e7-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "podgotovka-vody-dlya-cherepah-tetra-reptosafe-100-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-177765", title: "Подготовка воды для черепах Tetra ReptoSafe 250 ml", long_name: "Кондиционер для подготовки воды для водных черепах Tetra ReptoSafe 250 мл", description: "ReptoSafe это жидкий кондиционер, быстро преобразующий водопроводную воду в пригодную для жизни рептилий. ReptoSafe связывает тяжелые металлы, полностью нейтрализует хлор и создает окружающую среду, максимально приближенную к природным условиям обитания черепах. Коллоидный раствор серебра защищает кожу черепах и сокращают риск возникновения кожных заболеваний. Магний и витамин В1 уменьшают стрессовый эффект и сокращают риск возникновения болезней. \nДозировка 5 мл. на 10 л. аквариумной воды.", price: 320.0, producer: "Tetra", item_id: "41e997a9-fdc5-11e2-81e7-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "podgotovka-vody-dlya-cherepah-tetra-reptosafe-250-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-780224", title: "Витамины для рептилий Tetra ReptoSol 50 ml", long_name: "Витамины в каплях для рептилий Tetra ReptoSol 50 мл ", description: "ReptoSol - высококачественная, мульти витаминная пищевая добавка для рептилий, содержащая все необходимые витамины.\nReptoSol способствует повышению природного иммунитета и предотвращает авитаминоз. Витамины добавляются в корм при помощи удобной пипетки, прекрасно воспринимается и усваивается.\n", price: 414.0, producer: "Tetra", item_id: "41e997b4-fdc5-11e2-81e7-bcaec546836b", group_id: "41e997ad-fdc5-11e2-81e7-bcaec546836b", permalink: "vitaminy-dlya-reptiliy-tetra-reptosol-50-ml", html_keywords: nil, html_description: nil},
  {item: "199446", title: "Подготовка воды Tetra SafeTabs 12 tab", long_name: "Таблетки для воды позволяющие реже менять воду Tetra SafeTabs 12 табл на 720 литров", description: "SafeTabs - таблетки преобразующие водопроводную воду в пригодную для жизни рыб. Препарат связывает тяжелые металлы и полностью нейтрализует хлор. Коллоидный раствор серебра защищает слизистые оболочки рыб, а магний и витамин В1 уменьшают стресс. Формула BioExtract, содержащая биополимерные вещества, гарантирует рост полезных бактерий, которые в свою очередь поддерживают чистоту и прозрачность аквариумной воды.\nРекомендуется применять при пересадке рыбы, при доливании водопроводной воды и вовремя карантина. Препарат улучшает условия для содержания и размножения аквариумных рыб. Помогает восстанавливаться рыбам после болезни.\nДозировка 1 таб. на 60 л. аквариумной воды.\nВремя действия таблетки 2 недели.\n", price: 342.0, producer: "Tetra", item_id: "41e997b5-fdc5-11e2-81e7-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "podgotovka-vody-tetra-safetabs-12-tab", html_keywords: nil, html_description: nil},
  {item: "Tet-139237", title: "Поддержание параметров воды TetraVital 100 ml", long_name: "Кондиционер для поддержания естественных условий TetraVital 100 мл на 200 л", description: "TetraVital - жидкий кондиционер, поддерживает в аквариуме среду, идентичную природной. Это поддерживает хорошее самочувствие и прекрасный внешний вид аквариумных рыб. Препарат стимулирует максимальное развитие природной окраски рыб и укрепляет их иммунитет. Содержит витамины группы В и йод, который служи для усиления роста водных растений и создания благоприятной среды для полезных микроорганизмов. TetraVita не заменим для успешного разведения рыб.\nДозировка 5 мл. на 10 л. аквариумной воды.\nПрименяется 1 раз в 4 недели.\n", price: 166.0, producer: "Tetra", item_id: "41e997b6-fdc5-11e2-81e7-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "podderzhanie-parametrov-vody-tetravital-100-ml", html_keywords: nil, html_description: nil},
