  {item: "Tet-204270", title: "Корм для черепах Tetra ReptoMin 1000 ml", long_name: "Гранулы для водных черепах Tetra ReptoMin 1000 мл", description: "Reptomin - витаминизированные гранулы для черепах с большим количеством легкоусваиваемых белков. Корм содержит все необходимые питательные вещества, витамины, микроэлементы, и минеральные вещества (для укрепления панциря и костей). Tetra ReptoMin экологически чистый продукт и хорошо воспринимается черепахами. ", price: 454.0, producer: "Tetra", item_id: "41e997bb-fdc5-11e2-81e7-bcaec546836b", group_id: "dcf9b962-f917-11e2-afe6-bcaec546836b", permalink: "korm-dlya-cherepah-tetra-reptomin-1000-ml", html_keywords: nil, html_description: nil},
