  {item: "Tet-140158", title: "Корм для черепах Tetra ReptoMin 250 ml", long_name: "Гранулы для водных черепах Tetra ReptoMin 250 мл", description: "Reptomin - витаминизированные гранулы для черепах с большим количеством легкоусваиваемых белков. Корм содержит все необходимые питательные вещества, витамины, микроэлементы, и минеральные вещества (для укрепления панциря и костей). Tetra ReptoMin экологически чистый продукт и хорошо воспринимается черепахами. ", price: 146.0, producer: "Tetra", item_id: "41e997bf-fdc5-11e2-81e7-bcaec546836b", group_id: "dcf9b962-f917-11e2-afe6-bcaec546836b", permalink: "korm-dlya-cherepah-tetra-reptomin-250-ml", html_keywords: nil, html_description: nil},
  {item: "215471", title: "Скала Aquael 5150AS", long_name: "Скала Aquael 5150AS для рапылителя Aquael Air Volcano", description: "Скала для распылителя Air Lights. Скала имитирует естественные скальные образования, а распылитель Air Lights создаёт цветные пузырьки воздуха, выплывающие из скалы, и  создающими мягкое, загадочное освещение в аквариме.\nОсобенно сильный декоративный эффект достигается вечером и ночью, после отключения основного освещения в аквариуме.\n\nРаспылитель в комплекте не поставляется, и покупается отдельно.", price: 0.0, producer: "Aquael", item_id: "160c10c7-f838-11e2-822a-bcaec546836b", group_id: "e5745e9a-f535-11e2-bd32-bcaec546836b", permalink: "skala-aquael-5150as", html_keywords: nil, html_description: nil},
  {item: "215472", title: "Скала Aquael 5151AS", long_name: "Скала Aquael 5151AS для рапылителя Aquael Air Volcano", description: "Скала для распылителя Air Lights. Скала имитирует естественные скальные образования, а распылитель Air Lights создаёт цветные пузырьки воздуха, выплывающие из скалы, и  создающими мягкое, загадочное освещение в аквариме.\nОсобенно сильный декоративный эффект достигается вечером и ночью, после отключения основного освещения в аквариуме.\n\nРаспылитель в комплекте не поставляется, и покупается отдельно.", price: 0.0, producer: "Aquael", item_id: "160c10c8-f838-11e2-822a-bcaec546836b", group_id: "e5745e9a-f535-11e2-bd32-bcaec546836b", permalink: "skala-aquael-5151as", html_keywords: nil, html_description: nil},
  {item: "100891", title: "Стакан Aquael Fan-1", long_name: "Стакан для фильтра Aquael Fan-1", description: "Стакан для фильтра Fan-1 в который помещается губка для Fan-1.\nГубка приобретается отдельно.", price: 189.0, producer: "Aquael", item_id: "160c10ca-f838-11e2-822a-bcaec546836b", group_id: "d05d7c09-f37b-11e2-affc-bcaec546836b", permalink: "stakan-aquael-fan-1", html_keywords: nil, html_description: nil},
