  {item: "100413", title: "Стакан Aquael Fan-mini", long_name: "Стакан для фильтра Aquael Fan-mini", description: "Стакан для фильтра Fan-1 в который помещается губка для Fan-1.\nГубка приобретается отдельно.", price: 156.0, producer: "Aquael", item_id: "160c10cd-f838-11e2-822a-bcaec546836b", group_id: "d05d7c09-f37b-11e2-affc-bcaec546836b", permalink: "stakan-aquael-fan-mini", html_keywords: nil, html_description: nil},
  {item: "109521", title: "Стерилизатор Aquael Mini-UV 0.5 w ", long_name: "Стерилизатор подходящий для всех внутренних фильтров Fun, Unifilter, Turbo, Circulator Aquael Mini-UV 0.5 w ", description: "Aquael Mini UV, - уникальный миниатюрный стерилизатор УФ для внутренних фильтров Fun, Unifilter, Turbo, Circulator.\nСтерилизатор выполнен в форме короткой гильзы которая надевается на сопло фильтра. Внутри находятся четыре энергосберегающие светодиода, излучающие ультрафиолетовый свет, который эффективно стерилизует воду. \nAquael Mini UV, - отлично удаляет водоросли из воды предотвращая их нарастание, убивает патогенные бактерии защищая рыбы от болезней, а также уничтожает протозоа, которые вызывают помутнение воды. Стерилизатор простой в установке и не требует дополнительного технического обслуживания, и оснащен собственным источником питания.\nБлагодаря своим размерам стерилизатор может использоваться даже в самых маленьких аквариумах.", price: 773.0, producer: "Aquael", item_id: "160c10dd-f838-11e2-822a-bcaec546836b", group_id: "160c10d2-f838-11e2-822a-bcaec546836b", permalink: "sterilizator-aquael-mini-uv-0-5-w", html_keywords: nil, html_description: nil},
