  {item: "AQ-02013", title: "Компрессор Aquael Oxyboost APR-300", long_name: "Компрессор одноканальный Aquael Oxyboost APR-300 производительность 300 л/ч", description: "Аквариумные компрессоры АPR-300 предназначены для насыщения воздухом воды в аквариуме. \nКомпрессоры типа APR имеют регулируемую подачу воздуха, поэтому могут быть использованы в аквариумах с меньшими объемом. \nКомпрессоры изготовлены с учетом действующих норм электробезопасности. Простая конструкция обеспечивает надежную работу компрессоров в течение длительного срока.  Компрессоры АPR-300 оснащены воздушным фильтром.\n", price: 615.0, producer: "Aquael", item_id: "d423f66e-f44c-11e2-af8c-bcaec546836b", group_id: "93856f94-f397-11e2-affd-bcaec546836b", permalink: "kompressor-aquael-oxyboost-apr-300", html_keywords: nil, html_description: nil},
  {item: "103255", title: "Нагреватель Aquael Easy Heater 100 w ", long_name: "Нагреватель с терморегулятором, противоударный в пластиковом корпусе Aquael Easy Heater 100 Вт", description: "Aquael Easy Heater 100W. Электронный пластиковый обогреватель с возможностью регулировки температуры от 18 до 36 градусов цельсия. Идеальная форма, исключительно точно работающий термостат. Устойчив к механическим повреждениям, полностью погружается в воду. Плоская форма дает возможность разместить его на любом стекле аквариума. Может работать в горизонтальном положении.\nДлинна 20 см.\nТолщина 9 мм.", price: 792.0, producer: "Aquael", item_id: "d423f682-f44c-11e2-af8c-bcaec546836b", group_id: "d423f675-f44c-11e2-af8c-bcaec546836b", permalink: "nagrevatel-aquael-easy-heater-100-w", html_keywords: nil, html_description: nil},
