  {item: "104827", title: "Нагреватель Aquael Easy Heater 150 w", long_name: "Нагреватель с терморегулятором, противоударный в пластиковом корпусе Aquael Easy Heater 150 Вт", description: "Aquael Easy Heater 150W. Электронный пластиковый обогреватель с возможностью регулировки температуры от 18 до 36 градусов цельсия. Идеальная форма, исключительно точно работающий термостат. Устойчив к механическим повреждениям, полностью погружается в воду. Плоская форма дает возможность разместить его на любом стекле аквариума. Может работать в горизонтальном положении.\nДлинна 20 см.\nТолщина 9 мм.", price: 822.0, producer: "Aquael", item_id: "d423f68f-f44c-11e2-af8c-bcaec546836b", group_id: "d423f675-f44c-11e2-af8c-bcaec546836b", permalink: "nagrevatel-aquael-easy-heater-150-w", html_keywords: nil, html_description: nil},
  {item: "Tet-793583", title: "Лекарство от дырчатой болезни Tetra ZMF Hexa-EX 6 tab", long_name: "Лекарство для рыб от дырчатой болезни Tetra ZMF Hexa-EX 6 таблеток на 300 л ", description: "ZMF Hexa-EX - лекарство для рыб от дырчатой болезни. Применение препарата поможет побороть Гексамитоз и Спиронуклеозом, а так же справиться с нарушениями работы кишечника у пресноводных и морских рыб. Особенно хорошо препарат помогает цихлидам. ZMF Hexa-EX действует мгновенно и  хорошо дезинфицирует аквариумную воду. Безопасен для рыб и растений.\n\nСпособ применения: 1 таблетка на 50 л воды. Для начала необходимо заменить 1/3 часть воды, затем добавить необходимое количество таблеток в соотношении к объему вашего аквариума. Далее необходимо обеспечить хорошую аэрацию, и ни в коем случае не использовать уголь и др. абсорбенты (нарушается ионный обмен). Курс лечения 5 дней. \nЧерез 14 дней необходимо повторное лечение для профилактики. В период лечения рекомендуется частичная замена воды. ", price: 290.0, producer: "Tetra", item_id: "94990c52-05a7-11e3-afa6-bcaec546836b", group_id: "e3cd913f-fab0-11e2-afe6-bcaec546836b", permalink: "lekarstvo-ot-dyrchatoy-bolezni-tetra-zmf-hexa-ex-6-tab", html_keywords: nil, html_description: nil},
  {item: "Tet-754898", title: "Лекарство от ихтиофтириуса Tetra ContraIck 100 ml", long_name: "Лекарство для рыб от ихтиофтириуса Tetra ContraIck 100 ml", description: "ContraIck - препарат для борьбы с ихтиофтириусом (точечной болезнью) и другими кожными паразитами, например костия и хилодонелла у аквариумных рыб. При правильном использовании лекарство не имеет побочных действий и не вредит аквариумным рыбам и растениям. Contralck быстро и равномерно растворяется в воде.\nПрепарат несовместим с TetraMedica Contraick plus. После лечения рекомендуется удалить лекарство с помощью фильтров с активированным углем, в этом случае не потребуется замена воды.\nДозировка: 5 мл на 20 л воды. При тяжелом картине возможно увеличить дозу до 5 мл на 10 л воды. Для чувствительных рыб - 5 мл на 40 л воды.\nВозможно повторение цикла лечения 3-4 раза.\n", price: 163.0, producer: "Tetra", item_id: "94990c53-05a7-11e3-afa6-bcaec546836b", group_id: "e3cd913f-fab0-11e2-afe6-bcaec546836b", permalink: "lekarstvo-ot-ihtioftiriusa-tetra-contraick-100-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-754577", title: "Лекарство от грибков Tetra FungiStop 100 ml", long_name: "Лекарство для рыб от грибков и бактерий Tetra FungiStop 100 мл на 400 л воды ", description: "FungiStop - лекарство для рыб с широким диапазоном воздействия от грибков, бактерий и паразитических заболеваний. Препарат быстро избавляет от плесневелых грибов, поражающих икру. FungiStop хорошо залечивает раны и защищает слизистую оболочку. Средство быстро и равномерно распространяется в воде и не имеет побочного действия. Препарат несовместим с Tetra FungiStop pius. При использовании лекарства нельзя использовать биологическую и химическую фильтрацию.\nДозировка: 5 мл. на 20 л. аквариумной воды. При сильном заболевании возможно увеличить дозировку до 5 мл. на 10 л.\nПеред употреблением флакон необходимо хорошо встряхнуть. \nВ случае отсутствия улучшений по прошествии 5 дней, рекомендуется повторить цикл.\nПеред повторением необходимо фильтровать воду угольным фильтром на протяжении 24 часов.\n", price: 163.0, producer: "Tetra", item_id: "94990c55-05a7-11e3-afa6-bcaec546836b", group_id: "e3cd913f-fab0-11e2-afe6-bcaec546836b", permalink: "lekarstvo-ot-gribkov-tetra-fungistop-100-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-754881", title: "Лекарство для рыб Tetra General Tonic 100 ml ", long_name: "Лекарство для рыб от бактерий и паразитов Tetra General Tonic 100 мл на 400 л воды ", description: "General Tonic - лекарство для рыб от бактерий и паразитов. Препарат так же способствует быстрому заживлению ран у аквариумных рыб и надежно дезинфицирует воду. Рекомендуется использовать General Tonic для профилактики гниения плавников. Лекарство не имеет побочных действий при правильном использовании и не вредит растениям и другим микроорганизмам в аквариуме. При использовании лекарства нельзя использовать биологическую и химическую фильтрацию.\nДозировка: 5 мл. на 20 л. При сильном заболевании возможно увеличить дозировку до 5 мл. на 10 л.\nВ случае отсутствия улучшений по прошествии 5 дней, рекомендуется повторить цикл.\nПеред повторением необходимо фильтровать воду угольным фильтром на протяжении 24 часов.\n", price: 163.0, producer: "Tetra", item_id: "94990c56-05a7-11e3-afa6-bcaec546836b", group_id: "e3cd913f-fab0-11e2-afe6-bcaec546836b", permalink: "lekarstvo-dlya-ryb-tetra-general-tonic-100-ml", html_keywords: nil, html_description: nil},
  {item: "793330", title: "Лекарство от червей API ZMF Gyrotox 12 tab", long_name: "Лекарство для рыб от червей сосальщиков API ZMF Gyrotox 12 капсул на 300 л ", description: "ZMF Gyrotox - лекарство для рыб от кожных и жаберных червей. Препарат содержит широкий спектр активных комплексных элементов и хорошо дезинфицирует воду. При правильном использовании не вредит рыбам и растениям а также не имеет побочных эффектов.\nДозировка: 12 капсул на 300 литров аквариумной воды. \nДействие препарата продолжается 24 часа.\nВозможно повторить цикл через 10-15 суток.\n", price: 324.0, producer: "Tetra", item_id: "94990c58-05a7-11e3-afa6-bcaec546836b", group_id: "e3cd913f-fab0-11e2-afe6-bcaec546836b", permalink: "lekarstvo-ot-chervey-api-zmf-gyrotox-12-tab", html_keywords: nil, html_description: nil},
  {item: "Tet-145634", title: "Ротор для внешнего фильтра Tetra EX1200", long_name: "Ротор для внешнего фильтра Tetra EX1200", description: "Ротор для внешнего фильтра EX1200. Ротор, это самая подвижная и самая важная деталь в канистровых фильтрах. Стержень ротора изготовлен из керамики, что обеспечивает ему долгую работу.\nКогда ротор выходит из строя снижается скорость потока воды и увеличивается гул.\n", price: 532.0, producer: "Tetra", item_id: "94990c5a-05a7-11e3-afa6-bcaec546836b", group_id: "d05d7c09-f37b-11e2-affc-bcaec546836b", permalink: "rotor-dlya-vneshnego-filtra-tetra-ex1200", html_keywords: nil, html_description: nil},
