  {item: "Tet-767423", title: "Корм на время выходных Tetra Weekend 20 Stick", long_name: "Корм на время выходных Tetra Weekend блоки 20 шт ", description: "TetraMin Weekend - корм выходного дня, для всех видов аквариумных рыб. В одной упаковки содержится 20 крупных стиксов (блоков) с повышенным содержанием питательных веществ и оптимально подобранным набором аминокислот. Дозировка корма рассчитывается, исходя из конкретного вида рыб, их количества, объёма воды. Может заменять обычный корма в течение 9 дней.", price: 143.0, producer: "Tetra", item_id: "f4e532eb-00da-11e3-afdd-bcaec546836b", group_id: "dcf9b962-f917-11e2-afe6-bcaec546836b", permalink: "korm-na-vremya-vyhodnyh-tetra-weekend-20-stick", html_keywords: nil, html_description: nil},
  {item: "Tet-198432", title: "Корм для цихлид Tetra Cichlid PRO 500 ml", long_name: "Корм для любых цихлид в чипсах Tetra Cichlid PRO 500 мл ", description: "Tetra Cichlid Pro – это полноценный, высококачественный основной корм, для цихлид в виде чипсов 2-х видов. Оранжевое ядро обогащено крилем и обеспечивает быстрый и здоровый рост, а зеленое ядро обогащено спирулиной, которая усиливает иммунную систему рыб. Внешнее кольцо содержит все необходимые питательные вещества. Корм усиливает естественную окраску рыб, хорошо усваивается и не загрязняет воду.\n\n", price: 338.0, producer: "Tetra", item_id: "f4e532ee-00da-11e3-afdd-bcaec546836b", group_id: "dcf9b962-f917-11e2-afe6-bcaec546836b", permalink: "korm-dlya-tsihlid-tetra-cichlid-pro-500-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-735859", title: "Корм для цихлид Tetra Cichlid Sticks 1 l", long_name: "Палочки для цихлид Tetra Cichlid Sticks 1 л ", description: "TetraCichlid Sticks - основной корм в виде палочек для всех видов цихлид и других крупных декоративных рыб. Палочки плавают на поверхности воды и благодаря своей форме принимают вид естественного природного корма крупных рыб. Корм усиливает натуральную окраску, жизненную энергию рыб и сопротивляемость болезням. Каждая палочка содержит оптимальное количество протеинов и аминокислот, для здорового роста и развития.", price: 653.0, producer: "Tetra", item_id: "f4e532f0-00da-11e3-afdd-bcaec546836b", group_id: "dcf9b962-f917-11e2-afe6-bcaec546836b", permalink: "korm-dlya-tsihlid-tetra-cichlid-sticks-1-l", html_keywords: nil, html_description: nil},
