  {item: "Tet-140066", title: "Корм для донных рыб Tetra WaferMix 100 ml", long_name: "Таблетки для донных рыб Tetra WaferMix 100 мл", description: "Полноценный премиум-корм, богатый питательными веществами – для всех видов донных рыб и ракообразных. Корм гарантирует разнообразное и оптимальное питание. Не загрязняет воду.", price: 159.0, producer: "Tetra", item_id: "ff1ad636-00fa-11e3-afdd-bcaec546836b", group_id: "dcf9b962-f917-11e2-afe6-bcaec546836b", permalink: "korm-dlya-donnyh-ryb-tetra-wafermix-100-ml", html_keywords: nil, html_description: nil},
