  {item: "543_0100", title: "Заживление ран, антистресс Dajana Aloe Gel 100 ml", long_name: "Средство обладает заживляющим  и антисептических действием Dajana Aloe Gel 100 ml", description: "Dajana Aloe Gel - отличается широким спектром заживляющего действия,  восстанавливает естественную защитную слизь на коже рыб и заживляет неглубокие ранения. Хорошо помогает при стрессах.  ", price: 118.0, producer: "Dajana", item_id: "de4a0cf6-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd913f-fab0-11e2-afe6-bcaec546836b", permalink: "zazhivlenie-ran-antistress-dajana-aloe-gel-100-ml", html_keywords: nil, html_description: nil},
  {item: "530_0100", title: "Удаление водорослей Dajana Algicid 100 ml", long_name: "Кондиционер для удаления ворослей Dajana Algicid 100 ml ", description: "Dajana Algicid высокоэффективное средство, препятствующее появлению водорослей и жгутиковых в аквариумах и небольших прудах. ", price: 90.0, producer: "Dajana", item_id: "de4a0cf7-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd9147-fab0-11e2-afe6-bcaec546836b", permalink: "udalenie-vodorosley-dajana-algicid-100-ml", html_keywords: nil, html_description: nil},
  {item: "523_0100", title: "Полезные бактерии Dajana Biofiltr 100 ml", long_name: "Живые денитрифицирующие бактерии Dajana Biofiltr 100 ml ", description: "Dajana Biofiltr - живые денитрифицирующие бактерии. Biofiltr содержит миллионы живых бактерий и ферментов, которые являются важной составной частью экосистемы аквариума.  Этот препарат активирует новый аквариум или фильтр, который начинает работать уже после нескольких часов. Бактерии заселяют фильтр и грунт, делают их биологически активными, удаляют из воды в аквариуме вредные соединения, такие как аммиак и нитриты. \nDajana Biofiltr полностью безопасен для всех аквариумных организмов, включая растения, поэтому при его применении не существует риска передозировки. \nПрепарат содержит различные виды культур бактерий и ферментов. Слишком высокая или низкая температура снижают их эффективность. \nРекомендуется хранить биостартеры при температуре 0 до +40°C. ", price: 115.0, producer: "Dajana", item_id: "de4a0cfa-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "poleznye-bakterii-dajana-biofiltr-100-ml", html_keywords: nil, html_description: nil},
  {item: "508_0100", title: "Лекарство от паразитов Dajana Bioicht 100 ml", long_name: "Дезинфицирующе средство от кожных паразитов Dajana Bioicht 100 ml ", description: "Dajana Bioicht - эффективное дезинфицирующее средство от кожных паразитов и жабровых червей. . Препарат слабо концентрированный и хорошо подходит начинающим аквариумистам или для обработки рыб, чувствительных к химикатам. Средство отлично подходит для добавления в воду при транспортировке живого корма, в качестве раствора, а так же для дезинфекции сачков или аквариумной техники. ", price: 86.0, producer: "Dajana", item_id: "de4a0cfc-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd913f-fab0-11e2-afe6-bcaec546836b", permalink: "lekarstvo-ot-parazitov-dajana-bioicht-100-ml", html_keywords: nil, html_description: nil},
  {item: "524_0100", title: "Очистка воды Dajana Clear Aqua 100 ml ", long_name: "Кондиционер для создания кристально чистой воды в аквариуме Dajana Clear Aqua 100 ml  ", description: "Dajana Clear Aqua - Кондиционер для создания кристально чистой воды в аквариуме. Препарат совершенно безвреден для рыб и аквариумных растений. Рекомендуется применение согласно инструкции на этикетке, хранить в темном и прохладном месте.", price: 109.0, producer: "Dajana", item_id: "de4a0cfe-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "ochistka-vody-dajana-clear-aqua-100-ml", html_keywords: nil, html_description: nil},
  {item: "503_0100", title: "Средство от паразитов Dajana Malachite Green 100 ml", long_name: "Дезинфицирующе средство от кожных паразитов (малахитовая зелень) Dajana Malachite Green 100 ml", description: "Dajana Malachite Green - дезинфицирующе средство от кожных паразитов. Препарат сильно концентрированный, поэтому рекомендуется строго соблюдать инструкцию по применению. ", price: 75.0, producer: "Dajana", item_id: "de4a0cff-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd913f-fab0-11e2-afe6-bcaec546836b", permalink: "sredstvo-ot-parazitov-dajana-malachite-green-100-ml", html_keywords: nil, html_description: nil},
