  {item: "561_0100", title: "Кислородные таблетки Dajana Oxygen Tabs 100 ml", long_name: "Таблетки повышающие содержание кислорода в аквариумной воде Dajana Oxygen Tabs 100 ml ", description: "Dajana Oxygen Tabs. Таблетки, повышающие содержание кислорода в аквариумной воде.\nКислородные таблетки применяются для замены компрессора при транспортировке рыб или когда отключают электричество. \nДозировка\n1 таблетка на 20 л воды 1 раз в день. ", price: 131.0, producer: "Dajana", item_id: "de4a0d05-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "kislorodnye-tabletki-dajana-oxygen-tabs-100-ml", html_keywords: nil, html_description: nil},
  {item: "521_0100", title: "Кислородное средство Dajana Oxyn Plus 100 ml", long_name: "Средство для увеличения содержания кислорода в аквариумной воде Dajana Oxyn Plus 100 ml", description: "Dajana Oxyn Plus - средство для увеличения содержания кислорода в аквариумной воде. Рекомендуется применять средство при сильном увеличении температуры воды, при перекорме или при сильной передозировке. Хорошо подходит для применения в аквариумах с живыми растениями. \n", price: 87.0, producer: "Dajana", item_id: "de4a0d06-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "kislorodnoe-sredstvo-dajana-oxyn-plus-100-ml", html_keywords: nil, html_description: nil},
  {item: "570_0050", title: "Таблетки для корней Dajana Plant Root 100 ml", long_name: "Таблетки для корневой системы растений для длительного удобрен Dajana Plant Root 100 ml ", description: "Dajana Plant Root - специальные таблетки для корневой системы растений для длительного удобрения. Таблетка содержит Fe, Mg, K, Mn, Zn, Bo, Mo, Cu в комплексной связи, и обеспечивает растения в аквариуме всеми необходимыми питательными веществами и микроэлементами, что способствует здоровому росту. Таблетки применяются для долговременного удобрения корней аквариумных растений. \nDajana Plant Root способствуют интенсивному росту корневой системы. \nПрименение \nПоместить 1 таблетку под корень каждого растения при посадке. В последствие добавлять 1 таблетку при каждой очистке дна и замене воды, не реже 1 раза в месяц.", price: 166.0, producer: "Dajana", item_id: "de4a0d09-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd9143-fab0-11e2-afe6-bcaec546836b", permalink: "tabletki-dlya-korney-dajana-plant-root-100-ml", html_keywords: nil, html_description: nil},
  {item: "506_0100", title: "Дезинфецирующее средство Dajana Prevent 100 ml", long_name: "Средство для профилактической дезинфекции аквариумной воды Dajana Prevent 100 ml", description: "Dajana Prevent - высокоэффективное средство для профилактической дезинфекции аквариумной воды. Рекомендуется применять при кормлении живым или замороженным кормом, а так же при появлении в аквариуме новых, декора или грунта.\nНе подходит для лечения специфических заболеваний.  \n", price: 76.0, producer: "Dajana", item_id: "de4a0d0b-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd913f-fab0-11e2-afe6-bcaec546836b", permalink: "dezinfetsiruyuschee-sredstvo-dajana-prevent-100-ml", html_keywords: nil, html_description: nil},
  {item: "522_0100", title: "Удобрение Dajana Proflor 100 ml ", long_name: "Это жидкое удобрение для подпитки растений Dajana Proflor 100 ml", description: "Dajana Proflor - жидкое легко усваиваемое удобрение для подпитки растений содержащие минеральные вещества и стабилизирующие pH в аквариуме.\nВ Dajana Proflor содержится этилендиаминотетрауксусная кислота (EDTA) которая связывает положительно заряженные микроэлементы (железо, цинк, марганец, медь) с молекулами органических соединений и образует комплексные соединения, так называемые хелаты. Прочная связь микроэлементов в хелатах улучшает их усвоение растениями и предотвращает нежелательное химическое соединение с веществами, которые могут привести к необратимой блокировке их поступления, например, с фосфором и железом.\n\n", price: 90.0, producer: "Dajana", item_id: "de4a0d0d-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd9143-fab0-11e2-afe6-bcaec546836b", permalink: "udobrenie-dajana-proflor-100-ml", html_keywords: nil, html_description: nil},
  {item: "520_0100", title: "Подготовка воды Dajana Start Plus 100 ml", long_name: "Кондиционер для подготовке воды при запуске аквариума, и при частичной подмене Dajana Start Plus 100 ml", description: "Dajana Start Plus - применяется для запуска аквариума либо при частичной замене воды. Препарат уменьшает содержание хлора, связывает тяжелые металлы, защищает и способствует образованию защитной слизи на коже рыбок. Start Plus преобразует водопроводную воду в пригодную для жизни рыб. \nАбсолютно безвредное средство.\n", price: 109.0, producer: "Dajana", item_id: "de4a0d0f-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "podgotovka-vody-dajana-start-plus-100-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-140349", title: "Удаление водорослей Tetra Algetten 12 tab", long_name: "Средство против водорослей, контроль обрастаний Tetra Algetten 12 таблеток", description: "Algetten - это медленно растворимые в воде таблетки для долгосрочного избавления от водорослей. Таблетки крепятся к стенке аквариума при помощи специального держателя, и выделяют активные вещества на протяжении 4-х недель. Эффект от применения препарата заметен уже на 4 - 6 день использования. Algetten не повреждает растения, не наносит ущерб полезной микрофлоре и не вызывает побочных эффектов. ", price: 183.0, producer: "Tetra", item_id: "de4a0d12-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd9147-fab0-11e2-afe6-bcaec546836b", permalink: "udalenie-vodorosley-tetra-algetten-12-tab", html_keywords: nil, html_description: nil},
  {item: "Tet-770386", title: "Удаление водорослей Tetra Algizit 10 tab", long_name: "Средство против водорослей быстрого действия Tetra Algizit 10 таблеток на 400 л", description: "Algizit - это средство для быстрого избавления от водорослей при сильном разростании их в аквариуме. Algizit не повреждает растения, не наносит ущерб полезной микрофлоре и не вызывает побочных эффектов. \nВнимание: во время применения препарата нельзя фильтровать воду через активированный уголь и другие абсорбенты, а также использовать, совместно с Algizit, препараты других фирм во избежание их несовместимости. \n", price: 188.0, producer: "Tetra", item_id: "de4a0d14-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd9147-fab0-11e2-afe6-bcaec546836b", permalink: "udalenie-vodorosley-tetra-algizit-10-tab", html_keywords: nil, html_description: nil},
  {item: "Tet-793552", title: "Удаление водорослей Tetra AlgoStopDepot 12 tab", long_name: "Средство против водорослей длительного действия Tetra AlgoStopDepot 12 таблеток на 600л", description: "AlgoStopDepot - это таблетки для уничтожения водоросле и долгосрочной профилактики их появления. Препарат эффективно уничтожает водоросли в пресноводных аквариумах, в том числе “черную бороду” и сине-зеленые водоросли, а также предотвращает их дальнейший рост. Таблетки необходио поместить на грунт. В течении 6 недель таблетки выделяют в воду комплекс веществ для уничтожения водорослей. Таблетка не растворяется полностью, а сохраняет свою первоначальную форму. Через 6 недель её необходимо убрать из воды.", price: 266.0, producer: "Tetra", item_id: "de4a0d15-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd9147-fab0-11e2-afe6-bcaec546836b", permalink: "udalenie-vodorosley-tetra-algostopdepot-12-tab", html_keywords: nil, html_description: nil},
  {item: "Tet-770416", title: "Удаление водорослей Tetra AlguMin 100 ml", long_name: "Средство против водорослей продолжительного действия Tetra AlguMin 100 мл на 200 л", description: "AlguMin мягкое средство против водорослей продолжит действия. Содержит гуминовые кислоты, которые создают полезный эффект \"черной воды\" и борются с водорослями естественным биологическим путем. При правильном применении препарат безвреден для рыб, растений и микроорганизмов. \nДозировка: 100 мл. на 200 л. аквариумной воды.", price: 109.0, producer: "Tetra", item_id: "de4a0d16-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd9147-fab0-11e2-afe6-bcaec546836b", permalink: "udalenie-vodorosley-tetra-algumin-100-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-751798", title: "Удаление водорослей Tetra AlguMin 250 ml", long_name: "Средство против водорослей продолжит действия Tetra AlguMin 250 мл на 500 л ", description: "AlguMin мягкое средство против водорослей продолжит действия. Содержит гуминовые кислоты, которые создают полезный эффект \"черной воды\" и борются с водорослями естественным биологическим путем. При правильном применении препарат безвреден для рыб, растений и микроорганизмов. \nДозировка: 250 мл на 500 л аквариумной воды.", price: 206.0, producer: "Tetra", item_id: "de4a0d17-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd9147-fab0-11e2-afe6-bcaec546836b", permalink: "udalenie-vodorosley-tetra-algumin-250-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-751804", title: "Удаление водорослей Tetra AlguMin 500 ml", long_name: "Средство против водорослей продолжит действия Tetra AlguMin 500 мл на 1000 л ", description: "AlguMin мягкое средство против водорослей продолжит действия. Содержит гуминовые кислоты, которые создают полезный эффект \"черной воды\" и борются с водорослями естественным биологическим путем. При правильном применении препарат безвреден для рыб, растений и микроорганизмов. \nДозировка: 500 мл. на 1000 л. аквариумной воды.", price: 360.0, producer: "Tetra", item_id: "de4a0d19-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd9147-fab0-11e2-afe6-bcaec546836b", permalink: "udalenie-vodorosley-tetra-algumin-500-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-762732", title: "Подготовка воды Tetra AquaSafe 100 ml", long_name: "Кондиционер для подготовки воды Tetra AquaSafe 100 мл на 200 л", description: "AquaSafe это жидкий кондиционер, быстро преобразующий водопроводную воду в пригодную для жизни рыб. AquaSafe связывает тяжелые металлы и полностью нейтрализует хлор. Коллоидный раствор серебра защищает слизистые оболочки рыб, а магний и витамин В1 уменьшают стресс. Совместно с AquaSafe рекомендуется применять TetraVital, препарат который содержит остальные витамины группы В и йод.\nКондиционер AquaSafe создает благоприятные условия для размножения рыб, стимулирует рост растений, а также способствует быстрому восстановлению рыб после болезни и обработки медикаментами. \nДозировка 5 мл.  на 10 л. аквариумной воды.\n", price: 136.0, producer: "Tetra", item_id: "de4a0d1a-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "podgotovka-vody-tetra-aquasafe-100-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-762749", title: "Подготовка воды Tetra AquaSafe 250 ml", long_name: "Кондиционер для подготовки воды Tetra AquaSafe 250 мл на 500 л", description: "AquaSafe это жидкий кондиционер, быстро преобразующий водопроводную воду в пригодную для жизни рыб. AquaSafe связывает тяжелые металлы и полностью нейтрализует хлор. Коллоидный раствор серебра защищает слизистые оболочки рыб, а магний и витамин В1 уменьшают стрессовый эффект. Совместно с AquaSafe рекомендуется применять TetraVital, препарат который содержит остальные витамины группы В и йод.\nКондиционер AquaSafe создает благоприятные условия для размножения рыб, стимулирует рост растений, а также способствует быстрому восстановлению рыб после болезни и обработки медикаментами. \nДозировка: 5 мл.  на 10 л. аквариумной воды.\n", price: 217.0, producer: "Tetra", item_id: "de4a0d1b-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "podgotovka-vody-tetra-aquasafe-250-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-736276", title: "Подготовка воды Tetra AquaSafe 500 ml", long_name: "Кондиционер для подготовки воды Tetra AquaSafe 500 мл на 1000 л", description: "AquaSafe это жидкий кондиционер, быстро преобразующий водопроводную воду в пригодную для жизни рыб. AquaSafe связывает тяжелые металлы и полностью нейтрализует хлор. Коллоидный раствор серебра защищает слизистые оболочки рыб, а магний и витамин В1 уменьшают стрессовый эффект. Совместно с AquaSafe рекомендуется применять TetraVital, препарат который содержит остальные витамины группы В и йод.\nКондиционер AquaSafe создает благоприятные условия для размножения рыб, стимулирует рост растений, а также способствует быстрому восстановлению рыб после болезни и обработки медикаментами. \nДозировка: 5 мл.  на 10 л. аквариумной воды.\n", price: 414.0, producer: "Tetra", item_id: "de4a0d1c-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "podgotovka-vody-tetra-aquasafe-500-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-177826", title: "Подготовка воды Tetra AquaSafe 50 ml", long_name: "Кондиционер для подготовки воды Tetra AquaSafe 50 мл на 100 л", description: "AquaSafe это жидкий кондиционер, быстро преобразующий водопроводную воду в пригодную для жизни рыб. AquaSafe связывает тяжелые металлы и полностью нейтрализует хлор. Коллоидный раствор серебра защищает слизистые оболочки рыб, а магний и витамин В1 уменьшают стрессовый эффект. Совместно с AquaSafe рекомендуется применять TetraVital, препарат который содержит остальные витамины группы В и йод.\nКондиционер AquaSafe создает благоприятные условия для размножения рыб, стимулирует рост растений, а также способствует быстрому восстановлению рыб после болезни и обработки медикаментами. \nДозировка: 5 мл.  на 10 л. аквариумной воды.\n", price: 84.0, producer: "Tetra", item_id: "de4a0d1e-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "podgotovka-vody-tetra-aquasafe-50-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-161313", title: "Подготовка воды Tetra Safe Start 100 ml", long_name: "Кондиционер для быстрого заселения аквариума Tetra AquaSafe Start 100 мл  ", description: "AquaSafe Start - кондиционер для быстрого заселения аквариума. Содержит уникальные живые бактерии, снижающие уровень аммиака и нитритов в аквариуме. AquaSafe Start создает благоприятные условия для размножения рыб, стимулирует рост растений, а также способствует быстрому восстановлению рыб после болезни и обработки медикаментами. \nРекомендуется использовать SafeStart совместно с AquaSafe, эта комбинация создаст идеальные условия для бактерий.\nДозировка:5 мл на 6 л аквариумной воды.\n\n", price: 468.0, producer: "Tetra", item_id: "de4a0d1f-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "podgotovka-vody-tetra-safe-start-100-ml", html_keywords: nil, html_description: nil},
  {item: "Tet-140257", title: "Полезные бактерии Tetra Bactozym 10 tab", long_name: "Живая бактериальная культура для запуска аквариума Tetra Bactozym 10 капсул на 1000 л", description: "Bactozym - живая бактериальная культура, для запуска аквариума 10 капсул на 1000 л. Препарат, обеспечивающий биологическую активность фильтра и аквариума в целом. Вызывает ферментативное разложение органических загрязнений. Улучшает качество воды, обеспечивает прозрачность и чистоту.\nСтимулирует и ускоряет разложение аммиака и нитритов с помощью специальных бактерий. При использовании во время установки нового аквариума, Bactozym позволяет запускать рыб уже через 24 часа. Замена воды в аквариуме и чистка фильтра может быть выполнена без снижения активности биологических бактерий. Оживляет микроорганизмы, ослабленные или поврежденные медицинскими препаратами. Для всех пресноводных и морских аквариумов.\nДозировка 10 капсул на 1000 л. аквариумной воды.", price: 335.0, producer: "Tetra", item_id: "de4a0d21-fb45-11e2-afe3-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "poleznye-bakterii-tetra-bactozym-10-tab", html_keywords: nil, html_description: nil},
  {item: "107271", title: "Стерилизатор Aquael Multy-UV 3 w", long_name: "Стерилизатор Aquael Multy-UV 3 w подходящий для всех внутренних фильтров Aquael Fun-2, Fun-3, Minikani, FZN Multy-UV 3 w", description: "Aquael Multy UV, - уникальный миниатюрный стерилизатор УФ для внутренних фильтров Fun-2, Fun-3, Minikani, FZN.\nСтерилизатор выполнен в форме короткой гильзы которая надевается на сопло фильтра. Внутри находятся четыре энергосберегающие светодиода, излучающие ультрафиолетовый свет, который эффективно стерилизует воду. \nAquael Mini UV, - отлично удаляет водоросли из воды предотвращая их нарастание, убивает патогенные бактерии защищая рыбы от болезней, а также уничтожает протозоа, которые вызывают помутнение воды. Стерилизатор простой в установке и не требует дополнительного технического обслуживания, и оснащен собственным источником питания.\nБлагодаря своим размерам стерилизатор может использоваться даже в самых маленьких аквариумах.", price: 1890.0, producer: "Aquael", item_id: "dcf9b95d-f917-11e2-afe6-bcaec546836b", group_id: "160c10d2-f838-11e2-822a-bcaec546836b", permalink: "sterilizator-aquael-multy-uv-3-w", html_keywords: nil, html_description: nil},
