  {item: "aq-03068", title: "Фильтр внутренний Aquael FAN-mini plus", long_name: "Фильтр внутренний Aquael FAN-mini plus 260 л/ч для аквариумов объемом до 50 л", description: "Aquael FAN Mini Plus, - инновационный аквариумный фильтр для очистки и аэрации воды в аквариумах объемом 30-60 литров. Фильтр не требует частого обслуживания, так как в нём правильно подобранная губка, расположенная на специально спроектированном перфорированном стержне. Благодаря пластиковому префильтру задерживаются крупные и средние частицы  грязи, гарантирует стабильность производительности. Благодаря инжектору для воздуха, вам теперь не потребуется компрессор.\nОснащен удобным и точным регулятором производительности, а так же плавной регулировкой направления потока воды. Обеспечивает бесшумную и надёжную работу. Прост в  установке и обслуживании.\n\n-  Аквариумный фильтр для очистки и аэрации воды в аквариуме.\n-  Удобное съёмное крепление. \n-  Не требует частого обслуживания.\n-  Поворачивающееся на 180' сопло выхода воды. \n-  Плавная регулировка мощности потока.\n-  Обеспечивает бесшумную и надёжную работу.\n-  Прост в  установке и обслуживании.\n-  Инжектор для воздуха, заменяет компрессор.", price: 484.0, producer: "Aquael", item_id: "d05d7c19-f37b-11e2-affc-bcaec546836b", group_id: "53f795ca-f2d6-11e2-bdef-bcaec546836b", permalink: "filtr-vnutrenniy-aquael-fan-mini-plus", html_keywords: nil, html_description: nil},
  {item: "105401", title: "Фильтр внешний Aquael mini kani 80", long_name: "Внешний фильтр Aquael mini kani 80 300 л/ч для аквариумов объёмом до 80 л ", description: "Aquael Minikani 80, - инновационный внешний канистровый фильтр для пресноводных аквариумов, акватеррариумов объемом до 80 литров. Фильтр Aquael Minikani объединил в себе плюсы двух разных групп фильтров. Обеспечивает высококачественную трехступенчатую биологическую, механическую и химическую фильтрацию воды в аквариуме. Внешний канистровый фильтр безопасный в работе и удобный в обслуживании.\nОсновным отличием от внешних фильтров классической комплектации является то, что небольшой насос высокой производительности находиться внутри аквариума. Легкая и точная регулировка мощности потока, удобство в обслуживании, а так же большой объем фильтрующего материала.\nОсновным отличием от внутренних фильтров это легкий и быстрый запуск фильтра, а так же бесшумная работа (мотор уже находиться в воде).\nЕдинственный внешний фильтр, который можно расположить выше уровня воды. Оптимально подходит для малых и средних аквариумов, а так же для аквариумов с водными черепахами.\nРазмеры (ДхШхВ): 19х17х32\nВес: 3 кг.", price: 2288.0, producer: "Aquael", item_id: "d05d7c1e-f37b-11e2-affc-bcaec546836b", group_id: "53f795ca-f2d6-11e2-bdef-bcaec546836b", permalink: "filtr-vneshniy-aquael-mini-kani-80", html_keywords: nil, html_description: nil},
  {item: "103107", title: "Фильтр внешний Aquael Unimax 250", long_name: "Внешний фильтр Aquael Unimax 250 1000 л/ч для аквариумов объёмом 150-250 л ", description: "Aquael UNIMAX 250 – качественный и тихий канистровый фильтр для очистки и аэрации воды в аквариумах объёмом до 250 литров. Оснащён специальным дождевальным устройством, за счет чего вода в аквариуме обогощается кислородом.\nОбеспечивает полноценную трёхступенчатую фильтрацию воды в аквариум механическую, химическую и биологическую. За счёт полноценной фильтрации вода в аквариуме становится чистой, здоровой и прозрачной. Фильтр оснащён возможностью регулировки производительности, что очень удобно в любом аквариуме.  Встроенный механизм для откачки воздуха из фильтра и эластичных  впускных трубок с целью автоматического наполнения фильтра водой. Благодаря этому миханизму нет необходимости наполнять фильтр водой вручную.\nФильтр оснащён двумя двигателями, а также двойным комплектом забора-подачи воды, благодаря чему достигается очень высокая производительность.  Для удобной транспортировки и установки канистры предвидены ролики. \nДхШхВ 30х24х41 см. \nВес: 6,4 кг. \n", price: 4928.0, producer: "Aquael", item_id: "d05d7c22-f37b-11e2-affc-bcaec546836b", group_id: "53f795ca-f2d6-11e2-bdef-bcaec546836b", permalink: "filtr-vneshniy-aquael-unimax-250", html_keywords: nil, html_description: nil},
  {item: "103108", title: "Фильтр внешний Aquael Unimax 500", long_name: "Внешний фильтр Aquael Unimax 500 2000 л/ч для аквариумов объёмом 250-500 л", description: "Aquael UNIMAX 500 – качественный и тихий канистровый фильтр для очистки и аэрации воды в аквариумах объёмом до 500 литров. Оснащён специальным дождевальным устройством, за счет чего вода в аквариуме обогощается кислородом.\nОбеспечивает полноценную трёхступенчатую фильтрацию воды в аквариум механическую, химическую и биологическую. За счёт полноценной фильтрации вода в аквариуме становится чистой, здоровой и прозрачной. Фильтр оснащён возможностью регулировки производительности, что очень удобно в любом аквариуме.  Встроенный механизм для откачки воздуха из фильтра и эластичных  впускных трубок с целью автоматического наполнения фильтра водой. Благодаря этому миханизму нет необходимости наполнять фильтр водой вручную.\nФильтр оснащён двумя двигателями, а также двойным комплектом забора-подачи воды, благодаря чему достигается очень высокая производительность.  Для удобной транспортировки и установки канистры предвидены ролики. \nДхШхВ 40х37х55 см. \nВес: 13,5 кг. \n", price: 7697.0, producer: "Aquael", item_id: "d05d7c26-f37b-11e2-affc-bcaec546836b", group_id: "53f795ca-f2d6-11e2-bdef-bcaec546836b", permalink: "filtr-vneshniy-aquael-unimax-500", html_keywords: nil, html_description: nil},
  {item: "103109", title: "Фильтр внешний Aquael Unimax 700 ", long_name: "Внешний фильтр Aquael Unimax 700 2250 л/ч для аквариумов объёмом 500-700 л", description: "Aquael UNIMAX 700 – качественный и тихий канистровый фильтр для очистки и аэрации воды в аквариумах объёмом до 700 литров. Оснащён специальным дождевальным устройством, за счет чего вода в аквариуме обогощается кислородом.\nОбеспечивает полноценную трёхступенчатую фильтрацию воды в аквариум механическую, химическую и биологическую. За счёт полноценной фильтрации вода в аквариуме становится чистой, здоровой и прозрачной. Фильтр оснащён возможностью регулировки производительности, что очень удобно в любом аквариуме.  Встроенный механизм для откачки воздуха из фильтра и эластичных  впускных трубок с целью автоматического наполнения фильтра водой. Благодаря этому миханизму нет необходимости наполнять фильтр водой вручную.\nФильтр оснащён двумя двигателями, а также двойным комплектом забора-подачи воды, благодаря чему достигается очень высокая производительность.  Для удобной транспортировки и установки канистры предвидены ролики. \nДхШхВ 40х37х61 см. \nВес: 14,1 кг. \n", price: 9783.0, producer: "Aquael", item_id: "93856f90-f397-11e2-affd-bcaec546836b", group_id: "53f795ca-f2d6-11e2-bdef-bcaec546836b", permalink: "filtr-vneshniy-aquael-unimax-700", html_keywords: nil, html_description: nil},
  {item: "61353", title: "Распылитель Aquael Air Lights", long_name: "Распылитель со светодиодами Aquael Air Lights в комплекте три цвета", description: "Aquael Air Lights, – оригинальный распылитель, оснащенный светодиодами. Внутри находится модуль с четырьмя диодами высокой яркости. В комплекте имеются три набора цветных насадок: красные, синие и зеленые. При использовании этих фильтров пузырьки воздуха, выплывающие из скалы, приобретают насыщенный цвет, выбранный вами, и создают мягкое, загадочное освещение внутри аквариума. Для работы аэратора нужен компрессор, который поставляется отдельно. \nОсобенно сильный декоративный эффект достигается вечером и ночью, после отключения основного освещения в аквариуме. Так как кислород рыбам особенно необходим ночью, то с помощью «Aquael Air Lights» вы сможете превратить аквариум в оригинальный ночной светильник.", price: 785.0, producer: "Aquael", item_id: "93856f9b-f397-11e2-affd-bcaec546836b", group_id: "93856f9a-f397-11e2-affd-bcaec546836b", permalink: "raspylitel-aquael-air-lights", html_keywords: nil, html_description: nil},
