  {item: "Tet-704183", title: "Подготовка воды Tetra AquaSafe 5 l", long_name: "Кондиционер для подготовки воды Tetra AquaSafe 5 л на10000 л", description: "AquaSafe это жидкий кондиционер, быстро преобразующий водопроводную воду в пригодную для жизни рыб. AquaSafe связывает тяжелые металлы и полностью нейтрализует хлор. Коллоидный раствор серебра защищает слизистые оболочки рыб, а магний и витамин В1 уменьшают стрессовый эффект. Совместно с AquaSafe рекомендуется применять TetraVital, препарат который содержит остальные витамины группы В и йод.\nКондиционер AquaSafe создает благоприятные условия для размножения рыб, стимулирует рост растений, а также способствует быстрому восстановлению рыб после болезни и обработки медикаментами. \nДозировка: 5 мл.  на 10 л. аквариумной воды.", price: 1775.0, producer: "Tetra", item_id: "00da3c57-932e-11e3-b099-bcaec546836b", group_id: "e3cd914b-fab0-11e2-afe6-bcaec546836b", permalink: "podgotovka-vody-tetra-aquasafe-5-l", html_keywords: nil, html_description: nil},
